import React from "react";
import './Prototyping.css';
import "@fontsource/red-hat-display";

import ui_ux_design from './resources/ui-ux-design.svg';
import ux_audit from './resources/ux-audit.svg';

import './../min.css';
function Works(){
    return(
        <>
        <div className="body-works">

            <div className="div-40 div-num" style={{"color":"#5C86A7"}}>
            <h2>How We Work.</h2>
            </div>
            <div className="div-60 div-num">
            <h4>Designing intuitive and attractive products requires through preparation and deep expertise</h4>
            <div className="checkMarkDiv"><img src={ux_audit} width="15" height="15"/> We setup your cloud Suscription </div>
                    </div>

        </div>
        <div className="body-works">

        <div className="div-40 div-num">
        <h4>Build 5 desktops on cloud for your team for free.</h4>
        <div className="checkMarkDiv"><img src={ux_audit} width="15" height="15"/> We setup your cloud Suscription </div>
        <div className="checkMarkDiv"><img src={ux_audit} width="15" height="15"/>  You only bear the infra cost no service charges</div>

        <div className="checkMarkDiv"><img src={ux_audit} width="15" height="15"/> secure Access </div>
        <br/>
        <div className="vir-button">Button 1</div>
    </div>
    <div className="div-60 div-num">
        <img src={ui_ux_design} className="div-50-img"/>
    </div>

    </div>
    </>

    );
}
export default Works;
